import React from "react";
import logo from "./logo.svg";
import "./App.css";
import FullName2 from "./FullName2";
import SoftDev from "./SoftDev";

function App() {
  return (
    <div className="App">
      <div id="name-wrapper">
        <div id="tape-holder">
          <FullName2 />
          <SoftDev />
        </div>
      </div>
    </div>
  );
}

export default App;
